import React from 'react'
import { useState } from 'react'
import {  useNavigate } from 'react-router-dom'

const Signup = () => {
  let navigate=useNavigate()
  const[credential,setCredential]=useState({email:"",password:""})
    const handlesubmit=async(e)=>{
        e.preventDefault()
        const response = await fetch(`http://localhost:4000/api/auth/login`, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },

          body: JSON.stringify({email:credential.email,password:credential.password})
        });
        const json=await response.json()
        console.log(json);
        if(json.success){
          // save the auth token and redirect
          localStorage.setItem('token',json.authtoken)
          navigate('/')
        }
        else{
          alert('please enter correct')
        }
    }

    const handlechange=(e)=>{
      setCredential({...credential,[e.target.name]:e.target.value})
    }
  return (
    <div>
    <form onSubmit={handlesubmit}>
  <div className="mb-3">
    <label htmlFor="name" className="form-label">Email address</label>
    <input type="text" className="form-control" id="name" name='name' onChange={handlechange} aria-describedby="name"/>
  </div>
  <div className="mb-3">
    <label htmlFor="email" className="form-label">Email address</label>
    <input type="email" className="form-control" name='email' id="email" onChange={handlechange} aria-describedby="email"/>
    <div id="email" className="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div className="mb-3">
    <label htmlFor="password" className="form-label">Password</label>
    <input type="password" className="form-control" id="password" onChange={handlechange} name='password'/>
  </div>
  <div className="mb-3">
    <label htmlFor="cpassword" className="form-label">Password</label>
    <input type="password" className="form-control" id="cpassword" onChange={handlechange} name='cpassword'/>
  </div>

  <button type="submit" className="btn btn-primary">Submit</button>
</form>
    </div>
  )
}

export default Signup
